evels(train$Pclass) \u003c- c(\u00221st Class\u0022, \u00222nd Class\u0022, \u00223rd Class\u0022)\n\n# png(\u00221_survival_by_class.png\u0022, width=800, height=600)\n# mosaicplot(train$Pclass ~ train$Survived, main=\u0022Passenger Survival by Class\u0022,\n#           color=c(\u0022#8dd3c7\u0022, \u0022#fb8072\u0022), shade=FALSE,  xlab=\u0022\u0022, ylab=\u0022\u0022,\n#           off=c(0), cex.axis=1.4)\n#dev.off()\n","dateCreated":"2016-09-13T15:46:26.93Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e473004\u003c/disk_kb_free\u003e\u003cdocker_image_id\u003esha256:179b4ead03d729011809fb0ea5d3208092dbe62fd4fb86ab7b387f366cb6e94b\u003c/docker_image_id\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003cfailure_message /\u003e\u003cout_of_memory\u003eFalse\u003c/out_of_memory\u003e\u003crun_time_seconds\u003e2.82969189796131\u003c/run_time_seconds\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003ctimeout_exceeded\u003eFalse\u003c/timeout_exceeded\u003e\u003cused_all_space\u003eFalse\u003c/used_all_space\u003e\u003cwas_killed\u003eFalse\u003c/was_killed\u003e\u003c/results\u003e","runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageDigest":null,"dockerImageId":"sha256:179b4ead03d729011809fb0ea5d3208092dbe62fd4fb86ab7b387f366cb6e94b","dockerImageName":"kaggle/rstats","diskKbFree":473004,"failureMessage":"","exitCode":0,"queuedSeconds":0,"outputSizeBytes":0,"runTimeSeconds":2.82969189796131,"usedAllSpace":false,"timeoutExceeded":false,"isValidStatus":false,"wasGpuEnabled":false,"wasInternetEnabled":false,"outOfMemory":false,"invalidPathErrors":false,"succeeded":true,"wasKilled":false},"outputFilesTotalSizeBytes":0,"dockerImageVersionId":null,"usedCustomDockerImage":false,"dataSources":[{"sourceType":"Competition","sourceId":3136,"datab
